SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "zipcodes" (gid serial PRIMARY KEY,
"objectid" numeric(10,0),
"zip" varchar(5),
"shape_area" numeric,
"shape_len" numeric);
SELECT AddGeometryColumn('','zipcodes','the_geom','4326','MULTIPOLYGON',2);
CREATE INDEX "zipcodes_the_geom_gist" ON "zipcodes" using gist ("the_geom" gist_geometry_ops);
COMMIT;
